import React from 'react'
import './Ride.css'
import Popup from 'reactjs-popup';

export default function RideHistory() {
  const myHistory = [
    {id: 1, pickup: '123 Apple Street', dropoff: '456 Banana Road', vehicle: 'car', date: Date.now()},
    {id: 1, pickup: '456 Banana Road', dropoff: '123 Apple Street', vehicle: 'car', date: Date.now()},
    {id: 1, pickup: '123 Apple Street', dropoff: '1515 George Mason Avenue', vehicle: 'truck', date: Date.now()}
  ]

  const onCancelClick = () => {

  }
  const onOkClick = () => {

  }


  return (
    <div className={'mainContainer'}>
      {
        myHistory.map(e => {
          return (
            <div className={'historyContainer'}>
              <p>From: "{e.pickup}" To: "{e.dropoff}" Vehicle: {e.vehicle} On: {e.date.toLocaleString('en-US', {  day: '2-digit',
                month: '2-digit',
                year: 'numeric'})}</p>
              <Popup trigger=
                {<button>Report Issue</button>}
                modal nested className={'modal'}>
                  <p>Thank you, your ride is scheduled.</p>
                  <label for="message">Please tell us about the issue:</label>
                  <textarea name="message" type="text" />
                <div className={'submitContainer'}>
                  <button onClick={onCancelClick} >Cancel</button>
                  <button onClick={onOKClick}>Submit</button>
                </div>
              </Popup>
            </div>
          )
        })
      }
    </div>
  )
}
